import React from 'react';
import ReportButton from '../components/ReportButton';
import FeatureCards from '../components/FeatureCards';

const Home = () => {
  return (
    <div>
      {/* Hero Section */}
      <section
        style={{
          backgroundColor: '#e8f5e9',
          padding: '50px 20px',
          textAlign: 'center',
          borderRadius: '10px',
          marginBottom: '20px',
        }}
      >
        <div className="container">
          <h1 style={{ color: '#388e3c', fontSize: '36px' }}>EcoGuard</h1>
          <p style={{ color: '#555', fontSize: '18px' }}>
            Protect the Earth, Starting with Your Report
          </p>
          <p style={{ color: '#555', fontSize: '16px' }}>
            EcoGuard is a platform that makes it easy for people to report environmental
            problems directly via interactive maps.
          </p>
          <ReportButton />
        </div>
      </section>

      {/* Feature Cards */}
      <FeatureCards />
    </div>
  );
};

export default Home;
